import React from 'react';
import { Link } from 'react-router-dom';
import imgMail from "../../../resources/mail.png";

const StepFour = ({ user }) => {
    return (
        <>
            <h3 className="mb-5 text-xl font-medium text-Dark dark:text-white">Oupia đã gửi mã đến <span className="text-blueTemplate font-bold">{user.email}</span>, hãy xác nhận để tiếp tục</h3>
            <div className="h-56 w-full flex justify-center">
                <img src={imgMail} alt="Send mail" className="h-56 w-56"/>
            </div>
            <h4 className="mt-5 text-xl font-thin text-gray-900 dark:text-white">Chưa nhận được mã? <Link className="text-Darker font-bold">Gửi lại</Link></h4>
        </>
    );
};

export default StepFour;
